interface AIWORKSPACE {
    /**
     * 更新工作空间的资源。
     */
    UpdateWorkspaceResource(query: UpdateWorkspaceResourceRequest): Promise<UpdateWorkspaceResourceResponse>;
    /**
     * 删除工作空间的成员。
     */
    DeleteMembers(query: DeleteMembersRequest): Promise<DeleteMembersResponse>;
    /**
     * 创建工作空间。
     */
    CreateWorkspace(query: CreateWorkspaceRequest): Promise<CreateWorkspaceResponse>;
    /**
     * 获取工作空间的成员列表。
     */
    ListMembers(query: ListMembersRequest): Promise<ListMembersResponse>;
    /**
     * 添加资源引用到工作空间。
     */
    CreateWorkspaceResource(query: CreateWorkspaceResourceRequest): Promise<CreateWorkspaceResourceResponse>;
    /**
     * 获取工作空间的权限。
     */
    GetPermission(query: GetPermissionRequest): Promise<GetPermissionResponse>;
    /**
     * 更新工作空间名称和描述信息。
     */
    UpdateWorkspace(query: UpdateWorkspaceRequest): Promise<UpdateWorkspaceResponse>;
    /**
     * 获取资源配额列表。
     */
    ListQuotas(query: ListQuotasRequest): Promise<ListQuotasResponse>;
    /**
     * 为工作空间内的成员添加某个角色，使其拥有角色的权限。
     */
    AddMemberRole(query: AddMemberRoleRequest): Promise<AddMemberRoleResponse>;
    /**
     * 获取工作空间内已关联的资源列表。
     */
    ListResources(query: ListResourcesRequest): Promise<ListResourcesResponse>;
    /**
     * 获取某个地域下的工作空间列表。
     */
    ListWorkspaces(query: ListWorkspacesRequest): Promise<ListWorkspacesResponse>;
    /**
     * 列出未加入工作空间的用户列表，这些用户可被加入工作空间成为成员。
     */
    ListWorkspaceUsers(query: ListWorkspaceUsersRequest): Promise<ListWorkspaceUsersResponse>;
    /**
     * 列举产品
     */
    ListProducts(query: ListProductsRequest): Promise<ListProductsResponse>;
    /**
     * 获取用户在工作空间内的权限列表。
     */
    ListPermissions(query: ListPermissionsRequest): Promise<ListPermissionsResponse>;
    /**
     * 添加用户到工作空间，作为工作空间的成员，可以添加多个用户为成员。
     */
    CreateMember(query: CreateMemberRequest): Promise<CreateMemberResponse>;
    /**
     * 删除工作空间内的成员角色。
     */
    RemoveMemberRole(query: RemoveMemberRoleRequest): Promise<RemoveMemberRoleResponse>;
    /**
     * 获取工作空间详细信息。
     */
    GetWorkspace(query: GetWorkspaceRequest): Promise<GetWorkspaceResponse>;
    /**
     * 获取工作空间的成员。
     */
    GetMember(query: GetMemberRequest): Promise<GetMemberResponse>;
    /**
     * 创建代码配置到PAI，支持配置Git的代码分支与CommitId。创建完成后，可以在DLC作业中引用。
     */
    CreateCodeSource(query: CreateCodeSourceRequest): Promise<CreateCodeSourceResponse>;
    /**
     * 创建一个数据集。
     */
    CreateDataset(query: CreateDatasetRequest): Promise<CreateDatasetResponse>;
    /**
     * 为数据集打标签。
     */
    CreateDatasetLabels(query: CreateDatasetLabelsRequest): Promise<CreateDatasetLabelsResponse>;
    /**
     * 指定ID，删除一个代码配置。
     */
    DeleteCodeSource(query: DeleteCodeSourceRequest): Promise<DeleteCodeSourceResponse>;
    /**
     * 删除数据集。
     */
    DeleteDataset(query: DeleteDatasetRequest): Promise<DeleteDatasetResponse>;
    /**
     * 删除数据集标签。
     */
    DeleteDatasetLabels(query: DeleteDatasetLabelsRequest): Promise<DeleteDatasetLabelsResponse>;
    /**
     * 获取一个代码配置的详细信息。
     */
    GetCodeSource(query: GetCodeSourceRequest): Promise<GetCodeSourceResponse>;
    /**
     * 获取数据集。
     */
    GetDataset(query: GetDatasetRequest): Promise<GetDatasetResponse>;
    /**
     * 查询代码配置列表，支持分页、排序和按条件过滤。
     */
    ListCodeSources(query: ListCodeSourcesRequest): Promise<ListCodeSourcesResponse>;
    /**
     * 获取某个工作空间下的数据集列表。
     */
    ListDatasets(query: ListDatasetsRequest): Promise<ListDatasetsResponse>;
    /**
     * 发布私有的代码配置到工作空间公开可见。
     */
    PublishCodeSource(query: PublishCodeSourceRequest): Promise<PublishCodeSourceResponse>;
    /**
     * 将私有数据集在工作空间内公开。
     */
    PublishDataset(query: PublishDatasetRequest): Promise<PublishDatasetResponse>;
    /**
     * 更新数据集，支持更新名称，描述等。
     */
    UpdateDataset(query: UpdateDatasetRequest): Promise<UpdateDatasetResponse>;
    /**
     * 添加自定义镜像到工作空间。
     */
    AddImage(query: AddImageRequest): Promise<AddImageResponse>;
    /**
     * 为镜像添加标签。
     */
    AddImageLabels(query: AddImageLabelsRequest): Promise<AddImageLabelsResponse>;
    /**
     * 购买产品，目前只支持购买DataWorks后付费、OSS后付费、PAI后付费、MaxCompute后付费。
     */
    CreateProductOrders(query: CreateProductOrdersRequest): Promise<CreateProductOrdersResponse>;
    /**
     * 删除工作空间，关联的资源不会释放，需要您自已释放。
     */
    DeleteWorkspace(query: DeleteWorkspaceRequest): Promise<DeleteWorkspaceResponse>;
    /**
     * 获取默认工作空间详情。
     */
    GetDefaultWorkspace(query: GetDefaultWorkspaceRequest): Promise<GetDefaultWorkspaceResponse>;
    /**
     * 获取镜像详情。
     */
    GetImage(query: GetImageRequest): Promise<GetImageResponse>;
    /**
     * 获取镜像标签列表。
     */
    ListImageLabels(query: ListImageLabelsRequest): Promise<ListImageLabelsResponse>;
    /**
     * 获取镜像列表。
     */
    ListImages(query: ListImagesRequest): Promise<ListImagesResponse>;
    /**
     * 发布镜像，把镜像的可见性从PRIVATE变为PUBLIC。
     */
    PublishImage(query: PublishImageRequest): Promise<PublishImageResponse>;
    /**
     * 删除镜像。
     */
    RemoveImage(query: RemoveImageRequest): Promise<RemoveImageResponse>;
    /**
     * 移除镜像标签。
     */
    RemoveImageLabels(query: RemoveImageLabelsRequest): Promise<RemoveImageLabelsResponse>;
    /**
     * 删除工作空间对资源的引用，不会删除底层的资源。
     */
    DeleteWorkspaceResource(query: DeleteWorkspaceResourceRequest): Promise<DeleteWorkspaceResourceResponse>;
    /**
     * 删除模型。
     */
    DeleteModel(query: DeleteModelRequest): Promise<DeleteModelResponse>;
    /**
     * 创建模型。模型是模型版本的集合，创建模型时需要指定模型名称，描述等信息。
     */
    CreateModel(query: CreateModelRequest): Promise<CreateModelResponse>;
    /**
     * 为模型创建标签。
     */
    CreateModelLabels(query: CreateModelLabelsRequest): Promise<CreateModelLabelsResponse>;
    /**
     * 为指定模型新增版本。
     */
    CreateModelVersion(query: CreateModelVersionRequest): Promise<CreateModelVersionResponse>;
    /**
     * 为模型版本创建标签。
     */
    CreateModelVersionLabels(query: CreateModelVersionLabelsRequest): Promise<CreateModelVersionLabelsResponse>;
    /**
     * 删除模型标签。
     */
    DeleteModelLabels(query: DeleteModelLabelsRequest): Promise<DeleteModelLabelsResponse>;
    /**
     * 删除模型版本。
     */
    DeleteModelVersion(query: DeleteModelVersionRequest): Promise<DeleteModelVersionResponse>;
    /**
     * 删除模型版本标签。
     */
    DeleteModelVersionLabels(query: DeleteModelVersionLabelsRequest): Promise<DeleteModelVersionLabelsResponse>;
    /**
     * 获取指定模型详情信息。
     */
    GetModel(query: GetModelRequest): Promise<GetModelResponse>;
    /**
     * 获取模型版本。
     */
    GetModelVersion(query: GetModelVersionRequest): Promise<GetModelVersionResponse>;
    /**
     * 获取模型版本列表。
     */
    ListModelVersions(query: ListModelVersionsRequest): Promise<ListModelVersionsResponse>;
    /**
     * 更新模型的基本配置信息。
     */
    UpdateModel(query: UpdateModelRequest): Promise<UpdateModelResponse>;
    /**
     * 更新模型版本。
     */
    UpdateModelVersion(query: UpdateModelVersionRequest): Promise<UpdateModelVersionResponse>;
    /**
     * 获取模型列表。
     */
    ListModels(query: ListModelsRequest): Promise<ListModelsResponse>;
    /**
     * 将某个工作空间指定为默认工作空间。
     */
    UpdateDefaultWorkspace(query: UpdateDefaultWorkspaceRequest): Promise<UpdateDefaultWorkspaceResponse>;
    /**
     * 获取服务模板列表，目前只支持pai平台提供服务模板。
     */
    ListServiceTemplates(query: ListServiceTemplatesRequest): Promise<ListServiceTemplatesResponse>;
    /**
     * 获取服务模板详情。目前只支持pai提供的服务模板。
     */
    GetServiceTemplate(query: GetServiceTemplateRequest): Promise<GetServiceTemplateResponse>;
}
export default AIWORKSPACE;
